import React from "react";
export default Card;
import Avatar from "avatar.jsx";

function Card(props) {
    return (
        <div className="card">
          <div className="top">
            <h2 className="cardname">{props.name}</h2>
            <Avatar imgUrl={props.imgURL}/>
          </div>
          <div className="bottom">
            <p className="info">{props.phone}</p>
            <p className="info">{props.email}</p>
          </div>
        </div>
    )
  }
